import React, { useState, useContext, useEffect } from "react";
import { Link, useHistory} from "react-router-dom";
import AuthContext from "../context/auth/authContext";
import CartContext from "../context/cart/cartContext";
import Alert from "./Alert";
import LoadingContext from "../context/loading/loadingContext";
import "../auth.css"; 
import {useNavigate} from "react-router-dom"
const Auth = (props) => {
  const { register, login, userLoaded, isAuthenticated } = useContext(AuthContext);
  const loadingContext = useContext(AuthContext).loading;
  const { loadCart } = useContext(CartContext);
  const { Loader } = useContext(LoadingContext);

  const [loading, setLoading] = useState(1);
  const [flag, setFlag] = useState(0);
  const [signUpData, setSignUpData] = useState({
    name: "",
    password: "",
    confirmPassword: "",
    email: "",
    number: "",
  });
  const [signInData, setSignInData] = useState({
    email: "",
    password: "",
  });
  const [inputType, setInputType] = useState("password");

  const history = useHistory();

  useEffect(() => {
    if (loadingContext) {
      setLoading(1);
    } else {
      setLoading(0);
    }
  }, [loadingContext]);

  useEffect(() => {
    if (!isAuthenticated && localStorage.getItem("token")) {
      setLoading(userLoaded());
      setLoading(0);
    }
    if (isAuthenticated) {
      setLoading(1);
      history.push("/");
      loadCart();
      setLoading(0);
    }
  }, [isAuthenticated, history]);

  const handleSignUpData = (e) => {
    setSignUpData({ ...signUpData, [e.target.name]: e.target.value });
  };

  const handleSignInData = (e) => {
    setSignInData({ ...signInData, [e.target.name]: e.target.value });
  };

  const clickHandle = () => {
    setFlag((prev) => prev ^ 1);
  };

  const eyeClick = () => {
    setInputType(inputType === "password" ? "text" : "password");
  };

  const handleSignIn = async (e) => {
    e.preventDefault();
    setLoading(1);
    await login(signInData);
    setLoading(0);
  };

  const handleSignUpSubmit = async (e) => {
    e.preventDefault();
    if (
      !signUpData.name ||
      !signUpData.email ||
      !signUpData.password ||
      !signUpData.confirmPassword ||
      !signUpData.number
    ) {
      return alert("Please fill all fields");
    }
    setLoading(1);
    await register(signUpData);
    setLoading(0);
  };

  return (
    <>
      <Alert />
      {loading === 1 ? (
        <Loader />
      ) : (
        <div className={flag === 0 ? "container1" : "container1 sign-up-mode"}>
          <div className="forms-container" style={{ width: "100%" }}>
            <div className="signin-signup">
              <form className="sign-in-form" onSubmit={handleSignIn}>
                <h2 className="title" style={{ fontFamily: "poppins" }}>
                  Sign in
                </h2>
                <div className="input-field">
                  <i className="fas fa-user" />
                  <input
                    name="email"
                    type="email"
                    placeholder="Email"
                    onChange={handleSignInData}
                  />
                </div>
                <div className="input-field">
                  <i className="fas fa-lock" />
                  <input
                    name="password"
                    type={inputType}
                    placeholder="Password"
                    onChange={handleSignInData}
                  />
                  <i className="fas fa-eye" onClick={eyeClick} />
                </div>
                <input type="submit" value="Login" className="btn solid" />
                <Link to="/forget" style={{ fontFamily: "Poppins" }}>
                  Forgot Password?
                </Link>
              </form>

              <form className="sign-up-form" onSubmit={handleSignUpSubmit}>
                <h2 className="title" style={{ fontFamily: "poppins" }}>
                  Sign up
                </h2>
                <div className="input-field">
                  <i className="fas fa-user" />
                  <input
                    name="name"
                    type="text"
                    placeholder="Name"
                    value={signUpData.name}
                    onChange={handleSignUpData}
                  />
                </div>
                <div className="input-field">
                  <i className="fas fa-envelope" />
                  <input
                    name="email"
                    type="email"
                    placeholder="Email"
                    value={signUpData.email}
                    onChange={handleSignUpData}
                  />
                </div>
                <div className="input-field">
                  <i className="fas fa-phone" />
                  <input
                    name="number"
                    type="text"
                    placeholder="Contact Number"
                    value={signUpData.number}
                    onChange={handleSignUpData}
                  />
                </div>
                <div className="input-field">
                  <i className="fas fa-lock" />
                  <input
                    name="password"
                    type="password"
                    placeholder="Password"
                    value={signUpData.password}
                    onChange={handleSignUpData}
                  />
                </div>
                <div className="input-field">
                  <i className="fas fa-lock" />
                  <input
                    name="confirmPassword"
                    type="password"
                    placeholder="Confirm Password"
                    value={signUpData.confirmPassword}
                    onChange={handleSignUpData}
                  />
                </div>
                <input type="submit" className="btn" value="Sign up" />
              </form>
            </div>
          </div>

          <div className="panels-container">
            <div className="panel left-panel">
              <div className="content">
                <h3 style={{ fontFamily: "poppins" }}>New here ?</h3>
                <p style={{ fontFamily: "poppins" }}>
                  Then Sign Up and Start Ordering!
                </p>
                <button className="btn transparent" onClick={clickHandle}>
                  Sign up
                </button>
              </div>
              <img src={require("../images/log.svg")} className="image" alt="" />
            </div>
            <div className="panel right-panel">
              <div className="content">
                <h3 style={{ fontFamily: "poppins" }}>One of us ?</h3>
                <p style={{ fontFamily: "poppins" }}>
                  Then Sign In and get Started!
                </p>
                <button className="btn transparent" onClick={clickHandle}>
                  Sign in
                </button>
              </div>
              <img
                src={require("../images/register.svg")}
                className="image"
                alt=""
              />
            </div>
          </div>
        </div>
      )}
    </>
  );
};

export default Auth;
